import React, { Component } from 'react'

import { Main } from '../index'

const headerProps = {
    icon: 'users',
    title: 'User',
    subtitle: 'Cadastro de usuários: Create, Read, Update and Delete'
}

class UserCrud extends Component {
    render() {
        return (
            <Main { ...headerProps }>
                Cadastro de usuário
            </Main>
        )
    }
}

export { UserCrud }
